import React from "react";
import { withRouter } from "react-router-dom";

// console.log(items);

const ArticleList = ({ items }) => (
  <ul>
    {items.map((item) => (
      <li key={item.id}>{item.title}</li>
    ))}
  </ul>
);

export default withRouter(ArticleList);
